// src/components/GenerateReport.js
import React, { useEffect, useState } from 'react';
import axios from '../api/axios'; // ✅ Use custom Axios instance

const GenerateReport = ({ token }) => {
  const [records, setRecords] = useState([]);
  const [vaccineFilter, setVaccineFilter] = useState('');

  useEffect(() => {
    const fetchData = async () => {
      try {
        const res = await axios.get('/register/display', {
          headers: { Authorization: `Bearer ${token}` } // ✅ Add token
        });
        setRecords(res.data || []);
      } catch (err) {
        console.error('Error loading data:', err);
      }
    };
    fetchData();
  }, [token]);

  const handleDownload = async (type) => {
    try {
      const res = await axios.get('/register/download', {
        params: { fileDownloadType: type },
        responseType: 'blob',
        headers: { Authorization: `Bearer ${token}` } // ✅ Add token
      });

      const url = URL.createObjectURL(new Blob([res.data]));
      const link = document.createElement('a');
      link.href = url;
      link.setAttribute('download', `vaccination_report.${type.toLowerCase()}`);
      document.body.appendChild(link);
      link.click();
      link.remove();
    } catch (err) {
      console.error(`Download ${type} failed:`, err);
    }
  };

  const filtered = records.filter(rec =>
    rec.vaccineName?.toLowerCase().includes(vaccineFilter.toLowerCase())
  );

  return (
    <div className="p-6 max-w-6xl mx-auto">
      <h2 className="text-2xl font-bold mb-6 text-center">Vaccination Report</h2>

      <div className="flex flex-col sm:flex-row justify-between items-center gap-4 mb-6">
        <input
          type="text"
          value={vaccineFilter}
          onChange={(e) => setVaccineFilter(e.target.value)}
          placeholder="Filter by Vaccine Name"
          className="border p-2 rounded w-full sm:w-1/2"
        />
        <div className="flex gap-2">
          <button onClick={() => handleDownload('CSV')} className="bg-blue-600 text-white px-4 py-2 rounded">CSV</button>
          <button onClick={() => handleDownload('PDF')} className="bg-green-600 text-white px-4 py-2 rounded">PDF</button>
        </div>
      </div>

      <table className="w-full border text-center">
        <thead className="bg-gray-100">
          <tr>
            <th className="p-2 border">Student Name</th>
            <th className="p-2 border">Vaccination Status</th>
            <th className="p-2 border">Vaccination Date</th>
            <th className="p-2 border">Vaccine Name</th>
          </tr>
        </thead>
        <tbody>
          {filtered.length === 0 ? (
            <tr><td colSpan="4" className="py-4 text-gray-500">No records found</td></tr>
          ) : (
            filtered.map((r, i) => (
              <tr key={i}>
                <td className="p-2 border">{r.studentName}</td>
                <td className="p-2 border">{r.vaccinationStatus ? 'Vaccinated' : 'Not Vaccinated'}</td>
                <td className="p-2 border">{r.vaccinationDate ? new Date(r.vaccinationDate).toLocaleDateString() : 'N/A'}</td>
                <td className="p-2 border">{r.vaccineName}</td>
              </tr>
            ))
          )}
        </tbody>
      </table>
    </div>
  );
};

export default GenerateReport;
